import React from 'react';
import {Row, Col, Container, Card, ListGroup} from 'react-bootstrap';
import './sidebar.css';
import '../../custom.scss';

function Example() {
  return (
        <Container fluid>
        
            <Row className='base'>
                
                    <SideCard/>
                
                <Col>
                    <Row  className="main">
                        <Col className='header'>XM Studio</Col>
                        <Col className='content'>'Elllllooo there mateyss!</Col>
                    </Row>
                </Col>
            </Row>
            
        </Container>
    )
}

function SideCard(){
    return(
        <Card bg='dark' className="card1">
            <ListGroup variant="flush">
                <ListGroup.Item>Cras justo odio</ListGroup.Item>
                <ListGroup.Item>Dapibus ac facilisis in</ListGroup.Item>
            <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
  </ListGroup>
        </Card>
    )
}

export default Example;
